  return (
    <nav className="navbar" >
      <h1>The Dojo Blog</h1>
      {/* <img src={logo} alt="gustaakh saale" /> */}
      <div className="links">
        <Link to="/">Home</Link>
        <Link to="/create" style={{ 
          color: 'white', 
          backgroundColor: '#f1356d',
          borderRadius: '8px' 
        }}>New Blog</Link>
        <Link to="/login">Login</Link> {/* Add link to the Login page */}
        <Link to="/register">Register</Link> {/* Add link to the Register page */}
      </div>
    </nav>
  );
}

export default Navbar;
